  - name: TEXT4000
    number: '6'
    value: The employees reported on H4 do not spend more than 25% of their time on
      federal election activity and therefore are not subject to 11 CFR 300.33(c)(2).    The
      committee does not use any national party transfers to fund Federal Election
      Activity.  The party utilizes a strict accounting method to ensure that national
      party transfers are being used only for permissible administrative and overhead
      expenses.  This accounting method also guarantees that all Federal Election
      Activity is being funded by contributions raised under the limitations and prohibitions
      of the Federal Election Campaign Act, as amended.    The funds reported on Schedule
      B supporting line 22 were not in any way used in connection with any federal
      election, or any federal candidate, or any activities that qualify as Federal
      Election Activity.  Rather these transferred funds were utilized solely in connection
      with state and non-federal candidates and activities.    The payments to individuals
      for office cleaning and computer consulting reported on H4 are not employees
      of the committee and therefore are not subject to 11 CFR 300.33(c)(2).    The
      phrase Voter registration table in the purpose field on H4 is generic in nature
      and does not support any federal candidate or any other Federal Election Activity.  The
      individuals who maintain these tables are not employees of the committee and
      therefore not subject to 11 CFR 300.33(c)(2).    The petty cash disbursements
      account is used for cash expenditures which do not exceed $100.00 to any person
      or purchase transaction.  No disbursements are made for candidates.    Regarding
      the transfer of joint fundraising proceeds, this is a final transfer, and all
      donor allocation memos have been previously itemized.
